import { 
    ChakraProvider,
    Input,
    Box,
    Center
} from '@chakra-ui/react'

export const Inputs = () =>{
    return(
        <ChakraProvider>
            <Center>
            <Box backgroundColor='#FFFFFF' borderRadius='25px' padding='15px' paddingTop='50px'>
        Insira seus dados:
        <Input placeholder="email" />
        <Input placeholder="password" />
        </Box>
        </Center>
        </ChakraProvider>
    )
}
